import { Box, createTheme } from "@mui/material";
import ourChatsJson from "./darkneonshadows.json";

export default function App() {
  const ourConversation: SnapchatChatConversation = ourChatsJson;

  enum ChatType {
    MEDIA,
    CHAT,
  }

  /**
   * The MUI theme for this web app.
   */
  const theme = createTheme({
    palette: {
      primary: {
        main: "#5EBBF9",
      },
      background: {
        default: "#0f0f0f",
      },
    },
    components: {
      MuiCssBaseline: {
        styleOverrides: {
          "*": {
            boxSizing: "border-box",
            padding: 0,
            margin: 0,
            scrollBehavior: "smooth",
          },
          a: {
            color: "inherit",
            textDecoration: "none",
          },
        },
      },
    },
  });

  interface SnapchatChat {
    sender: string;
    receiver: string;
    type: string;
    text: string;
    timestamp: string;
  }

  interface SnapchatChatConversation {
    users: String[];
    chats: SnapchatChat[];
  }

  function generateMessagesBox() {
    return (
      <Box
        sx={{
          margin: 0,
          display: "flex",
          flexDirection: "column",
          width: "100vw",
          height: "100vh",
          backgroundColor: "#252525",
        }}
      ></Box>
    );
  }

  return generateMessagesBox();
}
